if(document.getElementById("back-to-top")){var scrollToTop=function(e){var a=window.scrollY,f=Math.PI/(e/15),b=a/2,c,d=0,g=setInterval(function(){0!=window.scrollY?(d+=1,c=b-b*Math.cos(d*f),window.scrollTo(0,a-c)):clearInterval(g)},15)},scrollTrigger=1E3,backToTop=function(){window.scrollY>scrollTrigger?document.getElementById("back-to-top").classList.add("show"):document.getElementById("back-to-top").classList.remove("show")};backToTop();window.addEventListener("scroll",function(){backToTop()})};